  "关于印发《重庆市巴南区党内关怀办法（修订）》的通知.txt": "1. 重庆市巴南区党内关怀办法（修订）明确关怀对象为三类：党龄40年及以上的农村老党员和未享受城镇养老保险的城镇老党员；年龄80周岁及以上且党龄55年及以上的老党员；以及因重大疾病、灾难、变故等导致家庭生活特别困难的党员。2. 敬老补助标准分三档：党龄40-49年补助100元/月，50-54年补助120元/月，55年及以上补助150元/月，自符合条件次月起按月发放。"
